import React from 'react';

function ProductsNav(){
    return(
        <div className="products__nav">
            <div className="link">
                <NavLink to="/all">All</NavLink>
            </div>
            <div className="link">
                <a href="all">print template</a>
            </div>
            <div className="link">
                <a href="all">web template</a>
            </div>
            <div className="link">
                <a href="all">user interface</a>
            </div>
            <div className="link">
                <a href="all">mock-up</a>
            </div>
        </div>
    );
}
export default ProductsNav;
